import React, { NavLink } from "react-dom";

function NavBar() {
  return (
    <div>
      <NavLink style={{ marginRight: "10px" }} to="/">
        Home
      </NavLink>
      <NavLink style={{ marginRight: "10px" }} to="/movies">
        Movies
      </NavLink>
    </div>
  );
}

export default NavBar;
